import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FiUsers, FiUserCheck, FiEye, FiDatabase, FiSettings, FiLogOut, FiUpload, FiEdit, FiShield, FiRefreshCw, FiSave } from 'react-icons/fi';
import { useAuth } from '../App';

export default function AdminPanel() {
  const { logout } = useAuth();
  const navigate = useNavigate();
  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 via-white to-indigo-100 p-0 fade-in relative">
      {/* Header */}
      <div className="flex items-center justify-between px-8 pt-8 pb-4">
        <h1 className="text-4xl font-bold bg-gradient-to-r from-blue-700 to-indigo-600 bg-clip-text text-transparent drop-shadow mb-0">Admin Dashboard</h1>
        <button
          onClick={handleLogout}
          className="p-3 rounded-full bg-red-500 hover:bg-red-600 text-white shadow-lg transition"
          title="Logout"
        >
          <FiLogOut size={24} />
        </button>
      </div>
      {/* Dashboard Grid */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8 px-8 pb-8">
        <Link to="/students" className="admin-tile">
          <FiUsers className="admin-tile-icon" />
          <div className="admin-tile-title">Student Database</div>
          <div className="admin-tile-desc">Manage student records</div>
        </Link>
        <Link to="/staff" className="admin-tile">
          <FiUserCheck className="admin-tile-icon" />
          <div className="admin-tile-title">Staff Database</div>
          <div className="admin-tile-desc">Manage staff records</div>
        </Link>
        <Link to="/unknowns" className="admin-tile">
          <FiEye className="admin-tile-icon" />
          <div className="admin-tile-title">Unknown Faces</div>
          <div className="admin-tile-desc">Review & enroll unknowns</div>
        </Link>
        <Link to="/upload" className="admin-tile">
          <FiUpload className="admin-tile-icon" />
          <div className="admin-tile-title">Upload Image</div>
          <div className="admin-tile-desc">Enroll new student/staff</div>
        </Link>
        <Link to="/college-info" className="admin-tile">
          <FiEdit className="admin-tile-icon" />
          <div className="admin-tile-title">College Info Editor</div>
          <div className="admin-tile-desc">Edit college/event info</div>
        </Link>
        <Link to="/chatlogs" className="admin-tile">
          <FiDatabase className="admin-tile-icon" />
          <div className="admin-tile-title">Chat Logs</div>
          <div className="admin-tile-desc">View chat interactions</div>
        </Link>
        {/* More admin options */}
        <Link to="#" className="admin-tile">
          <FiSettings className="admin-tile-icon" />
          <div className="admin-tile-title">System Settings</div>
          <div className="admin-tile-desc">Configure system preferences</div>
        </Link>
        <Link to="#" className="admin-tile">
          <FiShield className="admin-tile-icon" />
          <div className="admin-tile-title">User Management</div>
          <div className="admin-tile-desc">Manage admin users</div>
        </Link>
        <Link to="#" className="admin-tile">
          <FiSave className="admin-tile-icon" />
          <div className="admin-tile-title">Data Backup</div>
          <div className="admin-tile-desc">Backup & restore data</div>
        </Link>
        <Link to="#" className="admin-tile">
          <FiRefreshCw className="admin-tile-icon" />
          <div className="admin-tile-title">System Refresh</div>
          <div className="admin-tile-desc">Restart/refresh services</div>
        </Link>
      </div>
      {/* Styles for admin tiles */}
      <style>{`
        .admin-tile {
          @apply bg-white dark:bg-gray-900 rounded-2xl shadow-xl p-8 flex flex-col items-center text-center hover:scale-105 transition transform duration-200 border border-blue-100 dark:border-gray-800 cursor-pointer;
          text-decoration: none;
        }
        .admin-tile-icon {
          @apply text-4xl text-blue-600 mb-3 drop-shadow;
        }
        .admin-tile-title {
          @apply text-xl font-bold text-blue-800 dark:text-white mb-1;
        }
        .admin-tile-desc {
          @apply text-gray-500 dark:text-gray-300 text-sm;
        }
      `}</style>
    </div>
  );
}
